[TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, systems, or internet services to intercept and potentially alter communications."],
    "Explanation": "This rule detects an HTTP attack attempt that tries to poison the Responder service, which is a technique used for man-in-the-middle attacks. The attacker tries to inject malicious code into the HTTP response to redirect the victim to a malicious server controlled by the attacker."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt that tries to poison the Responder service, which is a technique used for man-in-the-middle attacks. The attacker tries to inject malicious content (an image tag pointing to a remote file) into the HTTP response, which could potentially allow them to intercept and manipulate network traffic."
  },
  {
    "sid": "50094",
    "Technique ID": "T1499",
    "Technique name": "Endpoint Denial of Service",
    "Quotes": ["Adversaries may perform Endpoint Denial of Service (EndDos) attacks to degrade or block the availability of services on a host."],
    "Explanation": "While the primary purpose of this attack seems to be a man-in-the-middle attempt, the injection of malicious content into HTTP responses could potentially lead to a denial of service condition on the targeted endpoint, making this technique also relevant."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt by the Responder tool, which is used for poisoning and hijacking network sessions. The rule looks for a specific pattern in the HTTP response that indicates an adversary attempting to perform an Adversary-in-the-Middle attack by redirecting traffic to a malicious server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)"],
    "Explanation": "This rule detects an HTTP attack attempt that tries to poison the Responder service, which is a technique used by adversaries to perform a man-in-the-middle attack and intercept network traffic."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt by the Responder tool, which is used to perform an Adversary-in-the-Middle attack by poisoning the browser cache and redirecting traffic through a malicious proxy server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1036",
    "Technique name": "Masquerading",
    "Quotes": ["Adversaries may attempt to manipulate features of their artifacts to make them appear legitimate or benign to users and/or security tools"],
    "Explanation": "This rule detects an HTTP attack attempt that tries to masquerade as a legitimate image request by using the 'file://' protocol handler to retrieve a malicious payload from a remote server. The attacker is attempting to make the request appear benign by disguising it as an image request."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, hosts, or processes to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt by the Responder tool, which is used for poisoning and performing man-in-the-middle attacks against the LLMNR, NBT-NS, and MDNS protocols. The rule looks for a specific pattern in the HTTP response that indicates the Responder tool is being used to perform an adversary-in-the-middle attack."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt by the Responder tool, which is used for poisoning and performing man-in-the-middle attacks against the LLMNR, NBT-NS, and MDNS protocols. The rule looks for a specific pattern in the HTTP response that indicates the Responder tool is attempting to redirect the client to a malicious server."
  },
  {
    "sid": "50094", 
    "Technique ID": "T1499",
    "Technique name": "Endpoint Denial of Service",
    "Quotes": ["Adversaries may perform Endpoint Denial of Service (EndDos) attacks to degrade or block the availability of services on target systems."],
    "Explanation": "While the primary purpose of the Responder tool is for man-in-the-middle attacks, it can also be used to perform denial of service attacks by flooding the target with spoofed responses, which could potentially lead to resource exhaustion or system crashes. This rule may also detect such denial of service attempts."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an HTTP attack attempt that tries to poison the Responder service, which is a technique used by adversaries to perform a man-in-the-middle attack and intercept network traffic."
  },
  {
    "sid": "50094",
    "Technique ID": "T1499",
    "Technique name": "Endpoint Denial of Service",
    "Quotes": ["Adversaries may perform Endpoint Denial of Service (EndDos) attacks to degrade or block the availability of services on a host."],
    "Explanation": "The Responder poisoning attack detected by this rule could potentially lead to a denial of service condition on the targeted endpoint by overwhelming it with malicious traffic or resource consumption."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1211",
    "Technique name": "Exploitation for Defense Evasion",
    "Quotes": ["Adversaries may exploit a system or application vulnerability to bypass security features"],
    "Explanation": "This rule detects an attempt to exploit a vulnerability in the Responder tool, which is used for poisoning the local network's NBNS, LLMNR, and MDNS responses. The exploitation aims to bypass security defenses and gain unauthorized access or execute malicious code."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50094",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an attempt to perform an HTTP attack known as 'Responder poisoner', which is a type of Adversary-in-the-Middle attack. The attacker attempts to insert a malicious image source URL into the HTTP response, which could potentially lead to code execution or other malicious actions on the client system."
  }
]', type='text')]

[TextBlock(text='[
  {
    "sid": "38563",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Adversaries may attempt to get information about the system from input capture on the user's machine."],
    "Explanation": "This Snort rule detects activity related to the Win.Trojan.GateKeylogger malware, which is designed to capture user input such as keystrokes. The rule looks for a fake '404 Not Found' response from the malware, which is a technique used by keyloggers to disguise their communication with a command and control server while capturing user input data."
